import { Navbar, Nav,NavDropdown,NavDropdownProps ,Container,Button,Form,FormControl } from 'react-bootstrap'
const Navigation = () => {
    return (
        <Navbar bg="dark" variant="dark" expand="lg" sticky="top">
            <Navbar.Brand href="#home">React Bootstrap Navbar</Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link href="/">Home</Nav.Link>
                    <Nav.Link href="/about-us">Contact Us</Nav.Link>
                    <Nav.Link href="/contact-us">About Us</Nav.Link>
                </Nav>
                <Form inline>

                    <Button variant="outline-success">Search</Button>
                </Form>
            </Navbar.Collapse>
        </Navbar>

        //!last working navbar , no colapsable button
        // <Navbar collapsOnSelect fized='top' expands='lg' bg="dark" variant='dark'>
        //     <Container>
        //         <Navbar.Toggle aria-controls='responsive-navbar-nav'/>
        //             <Navbar.Collapse id = 'responsive-navbar-nav'> 
        //                 <Nav>
        //                     <Nav.Link href='/Portal'>Home</Nav.Link>
        //                     <Nav.Link href='/App'>Testing</Nav.Link>
        //                 </Nav>
        //             </Navbar.Collapse>
        //     </Container>
        // </Navbar>
    );
}

export default Navigation
